43	3	1	 	<p><img width="2400" height="100" style="vertical-align: top;" src="/pluginfile.php/71643/mod_folder/content/0/Manual%20handling%20sworn%20banner%203.png" /></p>\n<table style="border: 1px solid #b5b8bc; background-color: #e4e5e6;" border="1">\n<tbody>\n<tr>\n<td>\n<p><span style="font-size: small;"><span style="color: #003366;"><strong>BEFORE YOU COMMENCE THIS COURSE: </strong></span>Please ensure that you complete the Hazardous Manual Handling E-Learning package before progressing to Course Completion. If you attempt to complete the course out of sequence, the hidden activity screen will appear <span style="color: #3399cc;"><a href="/pluginfile.php/71394/mod_resource/content/1/HiddenActivity.PNG" target="_blank"><span style="color: #3399cc;">(see example)</span></a></span> and you will redirected back to the Course Home page.</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><link href="/pluginfile.php/71642/mod_folder/content/0/jquery-ui.css" rel="stylesheet" /></p>\n<script src="/pluginfile.php/71642/mod_folder/content/0/jquery-1.10.2.js" type="text/javascript"></script>\n<script src="/pluginfile.php/71642/mod_folder/content/0/jquery-ui.js" type="text/javascript"></script>\n<div id="tabs">\n<ul>\n<li><a href="#fragment-1"><span>Course Purpose</span></a></li>\n<li><a href="#fragment-2"><span>Learning Outcomes</span></a></li>\n<li><a href="#fragment-3"><span>Course Duration</span></a></li>\n<li><a href="#fragment-4"><span>Course Accessibility</span></a></li>\n<li><a href="#fragment-5"><span>Course Contact</span></a></li>\n</ul>\n<div id="fragment-1">\n<p>This course will allow members to have an increased awareness and knowledge and to understand and apply the Zero Harm philosophy to all Victoria Police work environments. This course, in particular, will focus on manual handling techniques, principles and application in the workplace. The course will provide training that enables employees to:</p>\n<ol>\n<li>Comply with relevant legislation and codes of practice on hazardous manual handling.</li>\n<li>Manage the risks associated with hazardous manual handling tasks.</li>\n<li>Develop and facilitate best practice hazardous manual handling procedures.</li>\n<li>Apply strategies and procedures that directly reduce the incidence of workplace injury and illness.</li>\n</ol></div>\n<div id="fragment-2">\n<p><strong>After completing all six modules, learners will:</strong></p>\n<ul>\n<li>Have an increased understanding and knowledge of what constitutes manual handling and how to manage hazardous manual handling tasks in the workplace.</li>\n<li>Have an increased understanding of how the spine works and the impact of manual handling and hazardous manual handling tasks on the spine.</li>\n<li>Be able to apply a range of best practice principles, techniques and procedures that directly reduce the incidence of hazardous manual handling tasks in controlled environments.</li>\n<li>Be able to optimise their office/work station environment to minimise the risks associated with sedentary work.</li>\n<li>Have an increased repertoire of risk prevention exercise and be able to use these exercises to minimise injury at work.</li>\n<li>Be able to apply safe working techniques and principles in the arrest and restraint of complaint and non-compliant subjects.</li>\n</ul>\n</div>\n<div id="fragment-3">\n<p>There are six modules to complete. Each module will take approximately 10-15 minutes to complete.</p>\n</div>\n<div id="fragment-4"><ol>\n<li>You will need to turn your speakers on or wear headphones.</li>\n<li>You will need a computer that has the latest version of Adobe Flash Player (contact the Helpdesk, if necessary).</li>\n<li>You will need to have a screen resolution at a minimum of 1280 x 1024.</li>\n</ol></div>\n<div id="fragment-5">\n<p>Course Contact Details</p>\n<table style="width: 100%;">\n<tbody>\n<tr>\n<td>\n<p><strong>Course Contact:</strong> James Kolozsi</p>\n<ul>\n<li>Address: OH&amp;S Operations Manager | Health, Safety &amp; Deployment</li>\n<li>Phone: (03) 9247 5489</li>\n<li>Email: <a href="mailto:James.Kolozsi@police.vic.gov.au" target="_blank">James Kolozsi</a></li>\n</ul>\n</td>\n<td>\n<p><strong>Course Authoriser:</strong> Commander Shane Cole</p>\n<ul>\n<li>Address: STRATEGIC HEALTH SAFETY &amp; WELLBEING</li>\n<li>Email: <a href="mailto:shane.cole@police.vic.gov.au" target="_blank">Shane Cole</a></li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n<div id="fragment-7">\n<p>\n<script type="text/javascript">// <![CDATA[\n$( "#tabs" ).tabs();\n// ]]></script>\n</p>\n<p></p>\n</div>\n<div class="home-item-parent"><a class="home-item" href="/mod/page/view.php?id=17374"><span class="home-item-thumb"><img width="145" height="145" src="/pluginfile.php/71643/mod_folder/content/0/Module%201.png" /></span> <span class="home-item-h4">Module 1: The Law</span> <br /><br /><span class="home-item-p">Click here to access this module.         </span></a></div>\n<div class="home-item-parent"><a class="home-item" href="/mod/page/view.php?id=17383"><span class="home-item-thumb"><img width="145" height="145" src="/pluginfile.php/71643/mod_folder/content/0/Module%202v1.png" /></span> <span class="home-item-h4">Module 2: The Spine</span> <br /><br /><span class="home-item-p">Click here to access this module.         </span></a></div>\n<div class="home-item-parent"><a class="home-item" href="/mod/page/view.php?id=17384"><span class="home-item-thumb"><img width="145" height="145" src="/pluginfile.php/71643/mod_folder/content/0/Module%203.png" /></span> <span class="home-item-h4">Module 3: Moving and Handling Techniques</span> <br /><br /><br /><span class="home-item-p">Click here to access this module.       <br /><br /><br /></span></a></div>\n<div class="home-item-parent"><a class="home-item" href="/mod/page/view.php?id=17385"><span class="home-item-thumb"><img width="145" height="145" src="/pluginfile.php/71643/mod_folder/content/0/Module%204.png" /></span> <span class="home-item-h