34	2	0		<p style="background-color:#FFFFFF; margin:0.5em; padding:1em; border-style: solid; border-width: 2px; border-color: #0059B3;"><strong>BEFORE YOU COMMENCE THIS COURSE:&nbsp;</strong>Please ensure that you complete the Hazardous&nbsp;Manual&nbsp;Handling&nbsp;E-Learning package before progressing to Course Completion. If you attempt to complete the course out of sequence, the hidden activity screen will appear <a href="https://u-vicpolice.catalyst-au.net/pluginfile.php/71394/mod_resource/content/1/HiddenActivity.PNG" target="_blank">(see example)</a>&nbsp;and you will redirected back to the Course Home page.</p>\r\n<p>&nbsp;</p>\r\n<div class="tab">\r\n  <button class="tablinks" onclick="openCity(event, 'CoursePurpose')">Course Purpose</button>\r\n  <button class="tablinks" onclick="openCity(event, 'LearningOutcomes')">Learning Outcomes</button>\r\n  <button class="tablinks" onclick="openCity(event, 'CourseDuration')">Course Duration</button>\r\n  <button class="tablinks" onclick="openCity(event, 'CourseAccessibility')">Course Accessibility</button>\r\n  <button class="tablinks" onclick="openCity(event, 'CourseContact')">Course Contact</button>\r\n</div>\r\n<div id="CoursePurpose" class="tabcontent">\r\n<h3>Course Purpose</h3>\r\n<p>This course will&nbsp;allow&nbsp;members to have an increased awareness and knowledge and to understand and apply the Zero Harm philosophy to all Victoria Police work environments. This course, in particular, will focus on manual handling techniques, principles and application in the workplace. The course will provide training that enables employees to:</p>\r\n<ol>\r\n<li>Comply with relevant legislation and codes of practice on hazardous&nbsp;manual handling.</li>\r\n<li>Manage the risks associated with hazardous&nbsp;manual handling tasks.</li>\r\n<li>Develop and facilitate best practice hazardous&nbsp;manual handling procedures.</li>\r\n<li>Apply strategies and procedures that directly reduce the incidence of workplace injury and illness.</li>\r\n</ol>\r\n</div>\r\n<div id="LearningOutcomes" class="tabcontent" style="display:none;">\r\n<h3>Learning Outcomes</h3>\r\n<p><strong>After completing all six modules, learners will:</strong></p>\r\n<ul>\r\n<li>Have an increased understanding and knowledge of what constitutes manual handling and how to manage hazardous manual handling tasks in the workplace.</li>\r\n<li>Have an increased understanding of how the spine works and the impact of manual handling and hazardous manual handling tasks on the spine.</li>\r\n<li>Be able to apply a range of best practice principles, techniques and procedures that directly reduce the incidence of hazardous manual handling tasks in controlled environments.</li>\r\n<li>Be able to optimise their office/work station environment to minimise the risks associated with sedentary work.</li>\r\n<li>Have an increased repertoire of risk prevention exercise and be able to use these exercises to minimise injury at work.</li>\r\n<li>Be able to apply safe working techniques and principles in the arrest and restraint of complaint and non-compliant subjects.</li>\r\n</ul>\r\n</div>\r\n<div id="CourseDuration" class="tabcontent" style="display:none;">\r\n<h3>Course Duration</h3>\r\n\r\n<p>There are six modules to complete. Each module will take approximately 10-15 minutes to complete.</p>\r\n</div>\r\n<div id="CourseAccessibility" class="tabcontent" style="display:none;">\r\n<h3>Course Accessibility</h3>\r\n<ol>\r\n<li>You will need to turn your speakers on or wear headphones.</li>\r\n<li>You will need a computer that has the latest version of Adobe Flash Player (contact the Helpdesk, if necessary).</li>\r\n<li>You will need to have a screen resolution at a minimum of 1280 x 1024.</li>\r\n</ol>\r\n</div>\r\n\r\n<div id="CourseContact" class="tabcontent" style="display:none;">\r\n<h3>Course Contact</h3>\r\n\r\n<p>Contact details removed</p>\r\n</div>\r\n\r\n<script>\r\nfunction openCity(evt, cityName) {\r\n    var i, tabcontent, t